import React from 'react';
import perfilIcon from '../images/profileIcon.svg';

function Header() {
  return (
    <header>
      <h1 data-testid="page-title">Receitas de Comida</h1>

      <button type="button" data-testid="search-top-btn">Buscar</button>
      <img data-testid="profile-top-btn" src={perfilIcon} alt="perfil" />
    </header>
  );
}

export default Header;
